import React, { useState } from 'react';
import { scaleTime } from 'd3-scale';
import { Slider, Rail, Handles, Tracks, Ticks } from 'react-compound-slider';
import {
  format,
  addHours,
  startOfToday,
  endOfToday,
  differenceInMilliseconds,
  isBefore,
  isAfter,
  addMinutes,
} from 'date-fns';

import SliderRail from './SliderRail';
import Track from './Track';
import Tick from './Tick';
import Handle from './Handle';
import { TimeRangeContainer } from './StyledComponents';
import { DisabledInterval, UpdateCallbackData } from './types';

const defaultProps: TimeRangeProps = {
  timelineInterval: [startOfToday(), endOfToday()],
  selectedInterval: [new Date(), addHours(new Date(), 1)],
  disabledIntervals: [],
  containerClassName: '',
  step: 1000 * 60 * 30, // 30 minutes in milliseconds
  ticksNumber: 48, // 30 minutes * 48 = 24 hours
  error: false,
  mode: 3,
  formatTick: (ms: number) => format(new Date(ms), 'HH:mm'),
  showNow: true,
};

function TimeRange(props: TimeRangeProps & typeof defaultProps) {
  const [selectedInterval, setSelectedInterval] = useState(
    props.selectedInterval || defaultProps.selectedInterval,
  );

  const disabledIntervals = getFormattedBlockedIntervals(
    props.disabledIntervals || defaultProps.disabledIntervals,
    props.timelineInterval || defaultProps.timelineInterval,
  );

  const domain = (props.timelineInterval || defaultProps.timelineInterval).map(
    (t) => Number(t),
  );

  const now = getNowConfig(
    props.timelineInterval || defaultProps.timelineInterval,
  );

  const onChange = (newTime: ReadonlyArray<number>) => {
    const formattedNewTime = newTime.map((t) => new Date(t));
    if (props.onChangeCallback) {
      props.onChangeCallback([formattedNewTime[0], formattedNewTime[1]]);
    }
  };

  const checkIsSelectedIntervalNotValid = (
    [start, end]: [number, number],
    source: { value: number },
    target: { value: number },
  ) => {
    const { value: startInterval } = source;
    const { value: endInterval } = target;

    if (
      (startInterval > start && endInterval <= end) ||
      (startInterval >= start && endInterval < end)
    )
      return true;
    if (start >= startInterval && end <= endInterval) return true;

    const isStartInBlockedInterval =
      start > startInterval && start < endInterval && end >= endInterval;
    const isEndInBlockedInterval =
      end < endInterval && end > startInterval && start <= startInterval;

    return isStartInBlockedInterval || isEndInBlockedInterval;
  };

  const onUpdate = (newTime: ReadonlyArray<number>) => {
    const { onUpdateCallback } = props;
    if (!onUpdateCallback) {
      return;
    }

    if (disabledIntervals?.length) {
      const isValuesNotValid = disabledIntervals.some(({ source, target }) =>
        checkIsSelectedIntervalNotValid(
          [newTime[0], newTime[1]],
          source,
          target,
        ),
      );
      const formattedNewTime = newTime.map((t) => new Date(t));
      onUpdateCallback({ error: isValuesNotValid, time: formattedNewTime });
      return;
    }

    const formattedNewTime = newTime.map((t) => new Date(t));
    onUpdateCallback({ error: false, time: formattedNewTime });
  };

  const getDateTicks = () => {
    const { timelineInterval, ticksNumber } = props;
    return scaleTime()
      .domain(timelineInterval || defaultProps.timelineInterval)
      .ticks(ticksNumber || defaultProps.ticksNumber)
      .map((t) => +t);
  };

  return (
    <TimeRangeContainer
      className={props.containerClassName || defaultProps.containerClassName}
    >
      <Slider
        step={props.step || defaultProps.step}
        domain={domain.map((t) => +t)}
        onUpdate={onUpdate}
        onChange={onChange}
        values={(selectedInterval || defaultProps.selectedInterval).map(
          (t) => +t,
        )}
        rootStyle={{ position: 'relative', width: '100%' }}
      >
        <Rail>
          {({ getRailProps }) => <SliderRail getRailProps={getRailProps} />}
        </Rail>

        <Handles>
          {({ handles, getHandleProps }) => (
            <>
              {handles.map((handle) => (
                <Handle
                  error={props.error || defaultProps.error}
                  key={handle.id}
                  handle={handle}
                  domain={domain}
                  getHandleProps={getHandleProps}
                />
              ))}
            </>
          )}
        </Handles>

        <Tracks left={false} right={false}>
          {({ tracks, getTrackProps }) => (
            <>
              {tracks?.map(({ id, source, target }) => (
                <Track
                  error={props.error || defaultProps.error}
                  key={id}
                  source={source}
                  target={target}
                  getTrackProps={getTrackProps}
                />
              ))}
            </>
          )}
        </Tracks>

        {disabledIntervals?.length && (
          <Tracks left={false} right={false}>
            {({ getTrackProps }) => (
              <>
                {disabledIntervals.map(({ id, source, target, color }) => (
                  <Track
                    error={props.error || defaultProps.error}
                    key={id}
                    source={source}
                    target={target}
                    getTrackProps={getTrackProps}
                    disabled={true}
                    color={color} // Pass the color property here
                  />
                ))}
              </>
            )}
          </Tracks>
        )}

        {props.showNow && (
          <Tracks left={false} right={false}>
            {({ getTrackProps }) => (
              <Track
                error={props.error || defaultProps.error}
                key={now?.id}
                source={now?.source}
                target={now?.target}
                getTrackProps={getTrackProps}
              />
            )}
          </Tracks>
        )}

        <Ticks values={getDateTicks()}>
          {({ ticks }) => (
            <>
              {ticks.map((tick) => (
                <Tick
                  key={tick.id}
                  tick={tick}
                  count={ticks.length}
                  format={props.formatTick || defaultProps.formatTick}
                />
              ))}
            </>
          )}
        </Ticks>
      </Slider>
    </TimeRangeContainer>
  );
}

TimeRange.defaultProps = defaultProps;

export default TimeRange;
